import React from 'react';
import { ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert } from 'react-native';

export default function App() {
  return (
    <View >
        <View style={styles.header}>
            <TouchableOpacity 
            ImageBackground={{uri:'https://avatars.mds.yandex.net/get-pdb/1906603/584dcbb8-a793-47d2-81a7-859da70b8f3b/s1200'}}
                style={styles.ProfileIcon}>
            
            </TouchableOpacity>
            <TouchableOpacity>
            <Text>Settings</Text>
            </TouchableOpacity>

        </View>
    </View>
  );
}

const styles = StyleSheet.create({
    ProfileIcon:{
        width:50,
        height:50,
    },
    Settings:{

    },
    header:{
        flex:1,
        flexDirection:'row',
        justifyContent:"space-between",
    
    },
  container:{
    flex: 1,
    marginTop:30,
    alignItems: 'center',
    justifyContent: 'center',
  },
});
